import Logo from "../Assets/logo2.png";
import React, { useState, useEffect } from "react";

import ProfiePic from "../Assets/Images/profile.png";

import { Menu, MenuItem, ListItemIcon, IconButton } from "@mui/material";
import { Logout } from "@mui/icons-material";
import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";

const NavBar = () => {

  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);




  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <div className="flex flex-row p-5  w-screen xs:text-xs sm:text-sm md:text-md lg:text-lg lg:h-[110px]  md:h-[5rem] sm:h-[4rem] xs:h-[3rem] bg-white rounded-sm shadow-inner font-roboto shadow-gray-500">
      <div className="flex flex-row w-screen  space-x-3 justify-between items-center lg:ml-7 lg:mr-5">
        <a href="/" className="lg:w-[162.64px] lg:h-4 lg:mb-8">
          <img
            className="lg:w-[106px] lg:h-[43px] xs:w-10 xs:h-5"
            alt=""
            src={Logo}
          />
        </a>
        <NavItem itemName="home" />
        <NavItem
          itemName="behaviors"

        />

        <div className="flex flex-row  space-x-3 items-center">
          <div className="flex flex-row justify-between items-center">
            <img
              src={ProfiePic}
              alt=""
              className="rounded-full lg:h-12 lg:w-12 xs:w-7 xs:h-7 "
            />

            <IconButton
              onClick={handleClick}
              sx={{
                display: "flex",
                alignItems: "center",
                textAlign: "center",
                marginTop: "14px",
              }}
            >
              <KeyboardArrowDownIcon className="mb-2 " />
            </IconButton>

            <Menu
              anchorEl={anchorEl}
              id="account-menu"
              open={open}
              onClose={handleClose}
